'use strict';

/**
 * This module is used to create Web Services to allow Kier send us Work Orders that we
 * save / update in our DB.
 */
var fs = require('fs'),
    path = require('path'),
    soap = require('soap'),
    async = require('async'),
    _ = require('underscore');

module.exports = {
    init: init
};

/**
 * Initialises a soap service based on a wsdl and defines functions which map
 * to operations in the wsdl.
 */
function init(fhServer, cb) {

    var soapServer;
    var xml = fs.readFileSync(path.resolve(__dirname, '../public/DataManager.wsdl'), 'utf8'),
        dataManagerService = {
            soapServices: {
                dataDictionary: {
                    getCategories: getCategories
                }
            }
        };
    soapServer = soap.listen(fhServer, '/ws/DataManager', dataManagerService, xml);
    cb();


}
